import React, {Component} from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <h2> Welcome to the Road</h2>
        <Nav/>
      </div>
    );
  }
}

class Nav extends Component {
render() {
  return (
    <div className="nav">
    <h2>navigation</h2>
    </div>
    );
  }
}

export default App;
